import Link from 'next/link';
import styled from 'styled-components';

export const HeaderLink = styled.a`
    font-size: 1.5em;
    text-align: center;
    color: palevioletred;
    text-decoration: none;
  `;
  
const Header = () => (
  <div>
    <Link href="/">
      <HeaderLink>Latest posts</HeaderLink>
    </Link>
    <Link href="/new">
      <a>New post</a>
    </Link>
  </div>
);
  
export default Header;
